  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the shorebird survey is
  to assess, to the extent possible within the period of time available ashore, the
  presence/absence, number, and distribution of shorebirds. The surveys primarily
  support Objective 3a in the CCPs of Howland Island, Baker Island, and Jarvis Island
  NWRs: Develop baseline migratory bird and other species information. This objective,
  in turn, pertains to the goal of contributing to the recovery, protection, and management
  efforts for all native species with special consideration for seabirds, migratory
  shorebirds, federally listed threatened and endangered species, and species of management
  concern.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
